import './index.css'
import { useState } from 'react'

export default function App() {
	const [landing, setLanding] = useState(true)
	const [menu, setMenu] = useState(true)
	const [penis, setPenis] = useState(false)
	const [moviePage, setMoviePage] = useState(false)

	function handleLanding() {
		setPenis(false)
		setLanding(true)
		setMenu(true)
		console.log('mayde it')
	}

	function handlePasswordAuth() {
		setLanding(false)
		setMenu(false)
		setPenis(true)
		setMoviePage(false)
		console.log('clicky')
	}
	function handleMovieAuth() {
		setLanding(false)
		setMenu(false)
		setPenis(false)
		setMoviePage(true)
		console.log('moive page clicked')
	}
	return (
		<div>
			<Menu
				menu={menu}
				penis={penis}
				onPasswordAuth={handlePasswordAuth}
				onMovieAuth={handleMovieAuth}
			/>
			<Landing landing={landing} onSetLanding={handleLanding} />
			{penis && <PasswordAuthenticator penis={penis} />}
			{moviePage && <MoviePage moviePage={moviePage} />}
		</div>
	)
}

function Landing({ landing }) {
	return (
		landing && (
			<>
				<div className="primary">
					<h1 className="font-face-ha-main">Studio Cabbage</h1>
					<h2 className="primary-sub">Data Visualization</h2>
					<h2 className="primary-sub-2">Studio</h2>
				</div>
			</>
		)
	)
}

function Menu({ menu, onPasswordAuth, onSetLanding, onMovieAuth, setPenis }) {
	return (
		menu && (
			<div className="react-menu hidden">
				<p className="react-header">React Projects:</p>
				<p className="react-item" onClick={onPasswordAuth}>
					Password Authenticator
				</p>
				<p className="react-item" onClick={onMovieAuth}>
					Movies To Watch
				</p>
			</div>
		)
	)
}

function PasswordAuthenticator({ onSetLanding, onPasswordAuth, setPenis }) {
	function handleClick(e) {
		setPenis(false)

		console.log('magoo')
	}
	return (
		<div className="auth-box">
			<span className="auth-x" onClick={handleClick}>
				X
			</span>
			<h2 className="sign-up-header">Sign Up</h2>
			<div className="user-name">
				<p>Enter User Name: </p>
				<input type="text" />
				<ul>
					<li>Name Available</li>
					<li>Min 6 characters</li>
					<li>Max 10 characters</li>
				</ul>
			</div>
			<div className="password-header">
				<p>Enter Password</p>
				<input type="text" />
				<ul>
					<li>Min 8 characters</li>
					<li>Contains one upper case letter</li>
					<li>Contains one lower case letter</li>
					<li>Contains one number</li>
					<li>Contains one symbol</li>
				</ul>
			</div>
		</div>
	)
}

function MoviePage({ onMovieAuth }) {
	return (
		<div className="movie-input">
			<span className="movie-x">X</span>
			<h3 className="movie-header">
				Enter a movie or TV show you want to see:
			</h3>
			<form>
				<select>
					<option value="0">Movie</option>
					<option value="1">TV Show</option>
				</select>
				<input></input>
				<button>Submit</button>
			</form>
		</div>
	)
}
